import React from "react";
import Model from "./Model";
import history from "../history";
const DeleteStream = () => {
  const handleFooter = () => (
    <>
      <button>Delete</button>
      <button>Cancle</button>
    </>
  );

  return (
    <div>
      <h1>delete streame</h1>
      <Model
        title="Delete Strema"
        content="Are you sure to delete the strema?"
        footer={handleFooter}
        handle={() => history.push("/")}
      />
    </div>
  );
};
export default DeleteStream;
